import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';
import EventCard from './components/EventCard';
import Footer from './components/Footer';
import Login from './components/Login';
import Signup from './components/Signup';
import Home from './components/Home';
import Concerts from './components/Concerts';
import NightClub from './components/Nightclub';
import Artists from './components/Artists';
import Promotions from './components/Promotions';
import Products from './components/Products';
import News from './components/News';
import BusinessCustomers from './components/BusinessCustomers';
import TicketProtection from './components/TicketProtection';
import './App.css';
import image1 from './images/image1.jpg';
import image2 from './images/image2.jpg';
import image3 from './images/image3.jpg';
import image4 from './images/image4.jpg';
import dreamcatcher from './images/dreamcatcher.png';
import anotherConcert from './images/another-concert.png';
import beautifulDay from './images/beautiful-day.png';
import fatCat from './images/fat-cat.png';
import coloristsMusicFestival from './images/colorists-music-festival.png';
import unleashed from './images/unleashed.png';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Routes>
            <Route path="/" element={
              <>
                <HeroSection />
                <div className="event-section">
                  <EventCard image={image1} title="Event 1" />
                  <EventCard image={image2} title="Event 2" />
                  <EventCard image={image3} title="Event 3" />
                  <EventCard image={image4} title="Event 4" />
                </div>
              </>
            } />
            <Route path="/concerts" element={<Concerts />} />
            <Route path="/night-club" element={<NightClub />} />
            <Route path="/artists" element={<Artists />} />
            <Route path="/promotions" element={<Promotions />} />
            <Route path="/products" element={<Products />} />
            <Route path="/news" element={<News />} />
            <Route path="/business-customers" element={<BusinessCustomers />} />
            <Route path="/ticket-protection" element={<TicketProtection />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
          </Routes>
        </div>
        <div className="concerts-grid">
        <img src={dreamcatcher} alt="Dream Catcher" />
        <img src={image1} alt="The Exclusive Private Party" />
        <img src={anotherConcert} alt="Another Concert" />
      </div>
      <section className="recommended-section">
        <h2>แนะนำสำหรับคุณ</h2>
        <div className="recommended-grid">
          <img src={beautifulDay} alt="Beautiful Day" />
          <img src={fatCat} alt="Fat Cat" />
          <img src={coloristsMusicFestival} alt="Colorists Music Festival" />
          <img src={unleashed} alt="Unleashed" />
        </div>
      </section>
    </div>
        <Footer />
    </Router>
  );
};

export default App;
